"""#Calcular la Entropía
La entropía mide la impureza o el desorden en un conjunto de datos
La fórmula de la entropía H Es:![Captura de pantalla 2024-10-06 a la(s) 3.14.46 p. m..png](data:image/png;base64,)
"""

import pandas as pd
import numpy as np

# Cargar el dataset
df = pd.read_csv('/content/Drive/MyDrive/datos/ejercicio8.csv')

# Calcular la entropía
def calcular_entropia(column):
    valores, conteos = np.unique(column, return_counts=True)
    probabilidades = conteos / len(column)
    entropia = -np.sum(probabilidades * np.log2(probabilidades))
    return entropia

# Calcular la entropía para la clase 'Genero'
entropia_genero = calcular_entropia(df['Genero'])
print(f'Entropía de la clase Genero: {entropia_genero}')

"""#Calcular la Ganancia"""

# Calcular la ganancia de información
def ganancia_informacion(df, feature, target):
    # Entropía inicial
    H_s = calcular_entropia(df[target])

    # Entropía después de la división
    valores, conteos = np.unique(df[feature], return_counts=True)
    H_sv = 0
    for i in range(len(valores)):
        subset = df[df[feature] == valores[i]]
        probabilidad = conteos[i] / np.sum(conteos)
        H_sv += probabilidad * calcular_entropia(subset[target])

    # Ganancia de información
    return H_s - H_sv

# Calcular ganancia de información para 'Tamaño del cabello'
ganancia = ganancia_informacion(df, 'Tamaño del cabello', 'Genero')
print(f'Ganancia de Información al dividir por Tamaño del cabello: {ganancia}')